import React , {components} from 'react'

export default class Tabs extends components {

    render(){
        return (
            <p className="panel-tabs">
            <a className="is-active">All</a>
            <a>Public</a>
            <a>Private</a>
            <a>Sources</a>
            <a>Forks</a>
          </p>
        )
    }
}
